import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../pages/home.css';

function Home() {
  /* declare the domain name */

  const userEmail = localStorage.getItem('key'); 

  var countWebToken = 0;

  if((userEmail == null) && (countWebToken == 0 )){
     console.log("Website token is" + userEmail);
     window.location.href = "/useraccount/login";
  }else{
    console.log("User Email is now - >" + userEmail );
    //hit api to check profile



    countWebToken =+1;
  }

  const [profile, setProfile ] = useState([true]);

  useEffect(() => {
    if((userEmail != null) && (countWebToken == 1))
    {
      axios.get('https://localhost:44311/api/controller/CheckProfile?ProfileId=' + userEmail)
        .then(response => {
          setProfile(response.data);

          console.log("Checking the profile exists" + response.data);
          console.log(response.data);

          if(response.data == 0)
          {
            //window.location.href = "";
          }
        })
        .catch(error => {
          console.error(error);
        });
    }

  }, []);




const [post, setPosts ] = useState ([]);

useEffect(() => {
  axios.get('https://jsonplaceholder.typicode.com/posts')
    .then(response => {
      setPosts(response.data);
      console.log(response.data);
    })
    .catch(error => {
      console.error(error);
    });
}, []);
/* Message API */

const [ messages, setMessages ] = useState ([]);
useEffect(() => {
  
},[]);

if (!post) return null;

const domainName = "http:localhost:3000";
const clubHouse = () => {  window.location.href = "clubHouse"; }

const newTenantApp = () => {  window.location.href =  "newTenant";  }

const maintenance = () => { window.location.href = "maintenance"; }

const tenantDocuments = () => { window.location.href = "tenantDocuments";  }

const payRent = () => { window.location.href = "payRent";  }

const complaints = () => { window.location.href = "complaints"  }

const meterUsage = () => { window.location.href = "meterUsage";  }

return (

  <div class="container">
    <div class="row">
      <h1> Messages </h1>
      <table class="table table-striped">
        <thead class="thead-dark">
          <tr>
            <th> Date </th>
            <th> Title </th>
            <th> Message </th>
            <th> Action </th>
            <td> </td>
          </tr>
  
        </thead>
        <tbody>
          {
              post.slice(0, 2).map((user, index ) => {
                return <tr key={index}>
                  <td>{user.id}</td>
                  <td>{user.title}</td>
                  <td>{user.body}</td>
                  <td> <button class="btn btn-primary"> View Message </button></td>
                  <td> <button class="btn btn-primary"> Mark As Read </button></td>
                </tr>
                 
              })
          }
               {/* <tr> 
                  <td> {post.userId} </td>
                  <td> {post.title} </td>
                  <td> {post.body }</td>
                  <td> <button class="btn btn-primary"> View Message </button></td>
                  <td> <button class="btn btn-primary"> Mark As Read </button></td>
                </tr>  */}          
        </tbody>
      </table>


    </div>
    <div class="row row-one">
        <div class="col-lg-4">
          <div class="home-tiles">
            <h2> Rentals </h2>
            <p> Rent due this month: </p>
            <div class="home-buttons">
              <div class="btn-section-one">
              <button onClick={payRent} class="btn btn-large btn-primary"> Pay Rent Now </button>
             
              </div>
              <div class="btn-section-two">
              <button class="btn btn-large btn-primary"> View Statements </button>
              </div>
            </div>
  
            
          </div> 
        </div> 
        <div class="col-lg-4">                  
          <div class="home-tiles">
              <h2> Visitors </h2>
              <p> Generate Visitors Code </p>
              <div class="home-buttons">
                <div class="btn-section-one">
                <button class="btn btn-large btn-primary"> Generate Code </button>
              
                </div>
                <div class="btn-section-two">
                <button class="btn btn-large btn-primary"> Delivery Code </button>
                </div>
              </div>
            </div>  
        </div>   

        <div class="col-lg-4">
          <div class="home-tiles">
              <h2> Meter Usage </h2>
              <p> View Meter Usage </p>
              <button onClick={meterUsage} class="btn btn-large btn-primary"> View Meter </button>
          </div>            
          
        </div>
    </div>

    <div class="row row-two">
      <div class="col-lg-4">
            <div className="home-tiles">
              <h2> Maintenance </h2>
              <p> Schedule Maintenance for you unit </p>
              <div class="home-buttons">
                <div class="btn-section-on">
                  <button onClick={maintenance} class="btn btn-large btn-primary"> Schedule Maintenance </button>              
                </div>   
              </div>    
            </div> 
      </div> 

      <div class="col-lg-4">                  
            <div class="home-tiles">
                <h2> Club House </h2>
                <p> Book the club house for your events </p>
                <div class="home-buttons">
                  <div class="btn-section-on">
                  <button onClick={clubHouse} class="btn btn-large btn-primary"> Book Club-House</button>   
                                  
                  </div>                 
                </div>
              </div>  
      </div>   

      <div class="col-lg-4">
            <div class="home-tiles">
                <h2> Tenant Documents </h2>
                <p> View Lease Agreements </p>
                <button onClick={tenantDocuments} class="btn btn-large btn-primary"> View Documents </button>
            </div>             
      </div>
    </div>

    <div class="row row-three">
      <div class="col-lg-4">
            <div class="home-tiles">
              <h2> Complaints </h2>
              <p> Log a complaint </p>
              <div class="home-buttons">
                <div class="btn-section-on">
                  <button onClick={complaints} class="btn btn-large btn-primary"> Log Complaint </button>              
                </div>   
              </div>    
            </div> 
      </div> 

      <div class="col-lg-4">                  
            <div class="home-tiles">
                <h2> Rules & Regulations  </h2>
                <p> View Complex Rules and Regulations </p>
                <div class="home-buttons">
                  <div class="btn-section-on">
                    <button class="btn btn-large btn-primary"> View Rules & Regs </button>                
                  </div>                 
                </div>
              </div>  
      </div>   

      <div class="col-lg-4">                  
            <div class="home-tiles" id="tenant-application">
                <h2> New Tenant Application  </h2>
                <p> Welcome to the Estate/Complex </p>
                <div class="home-buttons">
                  <div class="btn-section-on">
                    <button onClick={newTenantApp} class="btn btn-large btn-primary"> Start Application </button>        
                  </div>                 
                </div>
              </div>  
      </div> 


    </div>


  </div>
  
      
    )
  }

export default Home;
